// client/src/components/HomePage.js
import React, { useState } from 'react';

const HomePage = ({ setCurrentPage }) => {
    
  const handleSubjectClick = (subject) => {
    // Navigate to Page2 when a subject button is clicked
    setCurrentPage('page2');
  };

  const handleFavouritesClick = () => {
    // Handle click on Favourites button
    // Implement logic to navigate to the Favourites page
  };


  return (
    <div className="home-page">
      {/* Navigation bar */}
      <nav className="navbar">
        <h1>GET YOUR REQUIRED QUESTION PAPERS</h1>
        <div className="navbar-right">
          {/* Favourites button */}
          <button onClick={handleFavouritesClick}>Favourites</button>
          {/* Logout button */}
          <button onClick={()=> setCurrentPage('signin')}>Logout</button>
        </div>
      </nav>

      {/* Subject buttons */}
      <div className="subject-buttons">
        <button onClick={() => handleSubjectClick('CSE')}>CSE</button>
        <button onClick={() => handleSubjectClick('ECE')}>ECE</button>
        <button onClick={() => handleSubjectClick('EEE')}>EEE</button>
        <button onClick={() => handleSubjectClick('MECH')}>MECH</button>
        <button onClick={() => handleSubjectClick('CIVIL')}>CIVIL</button>
        <button onClick={() => handleSubjectClick('BIO')}>BIO</button>
        <button onClick={() => handleSubjectClick('CHEM')}>CHEM</button>
        <button onClick={() => handleSubjectClick('MME')}>MME</button>
        {/* Add buttons for other subjects */}
      </div>
    </div>
  );
};

export default HomePage;
